import React from 'react';

// STYLE
import styled, { css } from 'styled-components';
import { borderBox } from '../shared/style';

// ELEMENTS
import { Grid, Button } from '../elements/index';

// COMPONENTS
import CommnunityPostList from '../components/CommunityPostList';

const CommunityDetail = () => {
  return (
    <>
    <Grid 
      bgColor="bgColor" 
      height="80vh" 
      margin="auto"
      addstyle={() => {
        return css`
          position:relative;
          top:80px;
        `;
      }}
      >
      <Button 
        width="55px"
        color="white"
        fontSize="40px"
        margin="30px"
        bgColor="olive"
        addstyle={() => {
          return css`
          height: 55px;
          border-radius: 50px;
          `;
        }}
      >+</Button>

      <Grid 
        width="350px" 
        height="auto" 
        addstyle={() => {
        return css`
          margin: 10px auto;
          font-size: 18px;
          font-weight: bold;
        `;
      }}
      > 
      평창동 동네 모임
      </Grid>
      <CommunityDetailStyle>
        <Grid margin="30px 0 0 0">
          <CommnunityPostList/>
          </Grid>
      </CommunityDetailStyle>

    </Grid>
    </>
  );
};


const CommunityDetailStyle = styled.div`
  border: 2px solid rgb(${(props) => props.theme.palette.olive});
  width: 350px;
  height: 70vh;
  margin: 10px auto;
  border-radius: 30px;
  overflow-y:scroll;
  overflow-x:hidden;
  -ms-overflow-style: none;

  &::-webkit-scrollbar { 
    display: none; 
  }
`;

export default CommunityDetail;
